class MyMainWindow(Ui_MainWindow):
    def __init__(self):
        super().__init__()

        # Create a layout for the Matplotlib widget


        self.group_box = self.findChild(QGroupBox, "groupBox_3")

        # Create a layout for the QGroupBox
        group_layout = QVBoxLayout(self.group_box)

        # Create a Matplotlib figure and canvas
        self.figure, self.canvas = plt.subplots()
        group_layout.addWidget(self.canvas)

    def draw_graph(self):
        payments = ["yes", "no", "yes", "yes", "no", "yes"]
        df = pd.DataFrame(payments, columns=["Payment Status"])
        payment_counts = df["Payment Status"].value_counts()

            # Clear the previous plot
        self.figure.clear()

            # Create a new bar chart
        payment_counts.plot(kind="bar", ax=self.figure.gca())

        # Add labels and a title
        plt.xlabel("Payment Status")
        plt.ylabel("Number of Clients")
        plt.title("Client Bill Payment Status for the Past 6 Months")

            # Redraw the canvas with the updated plot
        self.canvas.draw()



